	@media only screen and (max-width: 768px) {
		background: linear-gradient(#e0bfa400, #c99d7e),
			url('/banner-mobile.png');
		background-size: cover;
	}

	& > span {
		position: absolute;
		z-index: 3;
		&[tl] {
			top: 0;
			left: 0;
