		&[tr] {
			top: -2px;
			right: 0;
			transform: rotate(90deg);
		}

		&[bl] {
			bottom: -4px;
			left: 0;
			transform: rotate(-90deg);
		}

		&[br] {
			bottom: -4px;
			right: -4px;
			transform: rotate(180deg);
		}
	}

	&__content {
		z-index: 100;
